import React from 'react';
import { useNavigate } from 'react-router-dom';

const Header = ({ user }) => {
  const navigate = useNavigate();

  const openProfilePage = () => {
    if (user === 'student') {
      navigate('/profile/student');
    } else if (user === 'coordinator') {
      navigate('/profile/coordinator');
    }
  };

  return (
    <header style={headerStyle}>
      <div style={logoContainerStyle}>
        <img src="logo.png" alt="College Logo" style={logoStyle} />
        <span style={collegeNameStyle}>College Name</span>
      </div>
      <button onClick={openProfilePage} style={profileButtonStyle}>
        Profile
      </button>
    </header>
  );
};

const headerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  backgroundColor: '#2c3e50',
  color: 'white',
  padding: '10px 20px',
};

const logoContainerStyle = {
  display: 'flex',
  alignItems: 'center',
};

const logoStyle = {
  width: '40px',
  height: '40px',
  marginRight: '10px',
};

const collegeNameStyle = {
  fontSize: '20px',
};

const profileButtonStyle = {
  padding: '10px 15px',
  backgroundColor: '#2980b9',
  border: 'none',
  color: 'white',
  cursor: 'pointer',
};

export default Header;
